// $( document ).ready(function() {

    if ($(window).width() > 1092) {
        //console.log( "131244123123123" );
        $(".tabs-mobile").each(function () {
            var eleWidth = $(this).width();
            if (eleWidth > 100) {
                $(this).css("min-width", (eleWidth + 25) + "px");
            } else {
                $(this).css("min-width", (eleWidth + 10) + "px");
            }
    
        });
    }
    
    
    $('.tabs-row .tabs-mobile').click(function () {
        $(this).addClass('tabs-items-active').siblings().removeClass('tabs-items-active');
    });
    
    $(".tabs-section").siblings('.row-tabs.container').children().removeClass('container');
    var tabCurrentScroll,tabOffsetTop = null;
    $(window).on('scroll', function () {
        (tabOffsetTop === null) ? tabOffsetTop = tabOffset() : tabOffsetTop;
        tabCurrentScroll = $(this).scrollTop();
        if (tabCurrentScroll >= tabOffsetTop) {
            $(".tabs-section").addClass("sticky-tab");
            $(".tabs-section").siblings(".row-tabs.container").css("margin-top", "50px");
        } else {
            $(".tabs-section").removeClass("sticky-tab");
            $(".tabs-section").siblings(".row-tabs.container").css("margin-top", "0px");
        }
    });
    
    
    function tabsMainFunction(evt, cityName) {
        var i, tabcontent, tablinks;
        tabcontent = document.getElementsByClassName("tabcontent");
        $('html, body').animate({
            scrollTop: $(".tabs-section").siblings(".row-tabs.container").offset().top - 136
        }, 500);
        for (i = 0; i < tabcontent.length; i++) {
            tabcontent[i].style.display = "none";
        }
        tablinks = document.getElementsByClassName("tabs-mobile");
        for (i = 0; i < tablinks.length; i++) {
            tablinks[i].className = tablinks[i].className.replace(" tabs-items-active", "");
        }
    
    
        document.getElementById(cityName).style.display = "block";
        evt.currentTarget.className += " tabs-items-active";
    }
    
    $(document).ready(function () {
    
        if ($(".cm-left .tabs-mobile .subnav").length == 0) {
    
            if ($(window).width() < 768) {
    
                //Custom Select Code Start
                //***********************************************************************************************************//
                var x, i, j, selElmnt, a, b, c;
                /*look for any elements with the class "custom-select":*/
                x = document.getElementsByClassName("custom-select-drop-tabs");
                for (i = 0; i < x.length; i++) {
                    selElmnt = x[i].getElementsByTagName("select")[0];
                    /*for each element, create a new DIV that will act as the selected item:*/
                    a = document.createElement("DIV");
                    a.setAttribute("class", "select-selected-tabs");
                    a.innerHTML = selElmnt.options[selElmnt.selectedIndex].innerHTML;
                    x[i].appendChild(a);
                    /*for each element, create a new DIV that will contain the option list:*/
                    b = document.createElement("DIV");
                    b.setAttribute("class", "select-items-tabs select-hide-tabs");
                    for (j = 0; j < selElmnt.length; j++) {
                        /*for each option in the original select element,
                        create a new DIV that will act as an option item:*/
                        c = document.createElement("DIV");
                        c.innerHTML = selElmnt.options[j].innerHTML;
    
                        /* $( '.tabcontent' ).hide();*/
    
                        var tabLen = $(".tabProdcontent").length,
                            initTabActive = true;
    
                        for (var z = 0; z < tabLen; z++) {
                            if (document.getElementById(z).style.display == "block") {
                                if (z != 0) {
                                    initTabActive = false;
                                    document.getElementById("tabsSelector").selectedIndex = z;
                                    $('.select-selected-tabs').html(document.getElementById("tabsSelector").options[z].innerHTML);
                                }
                            }
                        }
    
                        if (initTabActive) {
                            $('#0').show();
                        }
    
    
    
    
                        c.addEventListener("click", function (e) {
                            /*when an item is clicked, update the original select box,
                            and the selected item:*/
                            var y, i, k, s, h;
                            s = this.parentNode.parentNode.getElementsByTagName("select")[0];
                            h = this.parentNode.previousSibling;
                            for (i = 0; i < s.length; i++) {
                                if (s.options[i].innerHTML == this.innerHTML) {
                                    s.selectedIndex = i;
                                    h.innerHTML = this.innerHTML;
                                    y = this.parentNode.getElementsByClassName("same-as-selected-tabs");
                                    for (k = 0; k < y.length; k++) {
                                        y[k].removeAttribute("class");
                                    }
                                    this.setAttribute("class", "same-as-selected-tabs");
                                    break;
                                }
                            }
    
    
                            var tabE = document.getElementById("tabsSelector");
                            //console.log( "hoi" );
                            var tabsUser = tabE.options[tabE.selectedIndex].value;
                            if (isNaN(tabsUser)) {
                                // var tabsUser = tabE.options[ tabE.selectedIndex ].href;
                                window.open(tabsUser, "_self");
                            }
                            else {
                                //console.log( tabsUser );
                                // $( '#Overview' ).hide();
                                $('.tabProdcontent').hide();
                                $('#' + tabsUser).show();
                                //$( '#1').show();
                            }
    
                            var selectedHeight = $(".tabs-section .select-selected-tabs").outerHeight();
                            if (selectedHeight > 36) {
                                $(".tabs-section .select-selected-tabs").css("padding", "8px 0px 0px 20px");
                                $(".tabs-section .select-items-tabs").css("margin-top", "8px");
                            }
                            else {
    
                                $(".tabs-section .select-selected-tabs").css("padding", "16px 0px 0px 20px");
                                $(".tabs-section .select-items-tabs").css("margin-top", "14px");
                            }
    
                            $('html, body').animate({
                                scrollTop: $('#' + tabsUser).offset().top - 138
                            }, 500);
    
                            h.click();
                        });
                        b.appendChild(c);
                    }
                    x[i].appendChild(b);
                    a.addEventListener("click", function (e) {
                        /*when the select box is clicked, close any other select boxes,
                        and open/close the current select box:*/
                        e.stopPropagation();
                        closeAllSelect(this);
                        this.nextSibling.classList.toggle("select-hide-tabs");
                        this.classList.toggle("select-arrow-active-tabs");
                    });
                }
    
                function closeAllSelect(elmnt) {
                    /*a function that will close all select boxes in the document,
                    except the current select box:*/
                    var x, y, i, arrNo = [];
                    x = document.getElementsByClassName("select-items-tabs");
                    y = document.getElementsByClassName("select-selected-tabs");
                    for (i = 0; i < y.length; i++) {
                        if (elmnt == y[i]) {
                            arrNo.push(i)
                        } else {
                            y[i].classList.remove("select-arrow-active-tabs");
                        }
                    }
                    for (i = 0; i < x.length; i++) {
                        if (arrNo.indexOf(i)) {
                            x[i].classList.add("select-hide-tabs");
                        }
                    }
                }
                /*if the user clicks anywhere outside the select box,
                then close all select boxes:*/
                document.addEventListener("click", closeAllSelect);
    
    
                //***********************************************************************************************************//
                //Custom dropdown code ends here 
            }
        }
    });
    
    $(function () {
        $('#colorselector').change(function () {
            $('.colors').hide();
            $('#' + $(this).val()).show();
        });
    });

    // if ($(".cm-left .tabs-mobile .subnav").length !== 0) {
        $(function () {
            // if ($(".cm-left .tabs-mobile .subnav").length !== 0) {
                $('.custom-DropDown > li').each(function () {
                    if ($(this).find('> ul').length) {
                        $(this).addClass('subMenu');
                    } else {
                        $(this).find('.accordIcon').remove();
                    }
                });
            // }
            if($('.custom-DropDownWrap li.subMenu').hasClass('active')){
                $('.custom-DropDownWrap').find('.selectedValue').text($('.custom-DropDownWrap li.active').find('div>a').text());
            }else if($('.custom-DropDownWrap li').hasClass('active')){
                $('.custom-DropDownWrap').find('.selectedValue').text($('.custom-DropDownWrap li.active').find('a').text())
            }
    
            $('.accordIcon').click(function () {
                $(this).toggleClass('active').parents('.subMenu').siblings().find('.accordIcon').removeClass('active');
			    $(this).parent('div').next().slideToggle().parents('.subMenu').siblings().find('ul').slideUp();
            });
    
            $('.custom-DropDownWrap .selectedValue').click(function () {
                $(this).toggleClass('active');
                $(this).next().slideToggle();
            })
    
            $(document).click(function (e) {
                if ($(e.target).closest(".custom-DropDownWrap").length == 0) {
                    $('.custom-DropDownWrap .selectedValue').removeClass('active');
                    $('.custom-DropDownWrap .selectedValue').next().slideUp();
					$('.custom-DropDown .subMenu ul').hide();
					$('.subMenu').siblings().find('.accordIcon').removeClass('active');

                }
            });
        })
    // }
